import React, { Component } from "react";
import "./App.css";
import Home from "./components/home";
import CreateSlam from "./components/create_slam";
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import OpenSlam from "./components/open_slam";
class App extends Component {
  render() {
    process.title = "App";
    return (
      <Router>
        <Switch>
          <Route path="/" exact={true} component={Home} />
          <Route path="/createSlam" exact={true} component={CreateSlam} />
          <Route path="/slam/:id" component={OpenSlam} />
        </Switch>
      </Router>
    );
  }
}

export default App;
